// returnHTML = children

export const iconlookup = {
  "About Me!": {
    ispanel: true,
    returnHTML: "<textarea><textarea/>",
  },
  "Linked-in": {
    ispanel: false,
    returnHTML: "https://www.linkedin.com/in/calvin-lin-b25618143/",
  },
  Github: {
    ispanel: false,
    returnHTML: "https://www.github.com/balbphegor",
  },
  "how it all started": {
    ispanel: false,
    returnHTML: "https://98.js.org/",
  },
  "celery man": {
    ispanel: "true",
    returnHTML:
      '<iframe src="https://www.youtube.com/embed/maAFcEU6atk" allow="accelerometer; autoplay"></iframe>',
  },
  monkey: {
    ispanel: true,
    returnHTML: '<img src="./assets/image.png"/>',
  },
};
